import React from 'react';
import {H1, SmallContainer} from '../components'
import styled from 'styled-components';

const Style = styled.div`
	display: flex;
	align-self: flex-start;
	justify-content: center;
	margin: 1rem;
	margin-top: 1rem;
	padding: 10px;
	position: relative;
	border: 5px solid black;
	width: 45%;
	height: auto;

	&:nth-of-type(even) {
		align-self: flex-end;
	}

	& .circle {
		background-color: #2E2E2E;
		border: 3px solid orange;
		border-radius: 50%;
		position: absolute;
		width: 20px;
		height: 20px;
		z-index: 1;
		right: -11%;
	}

	&:nth-of-type(even) .circle {
		left: -11%;
		border-color: red;		
	}


`;

class TimelineItem extends React.Component {
	render() {
		return(
	    	<Style>
	    		<SmallContainer width='100%'><H1>{this.props.title}</H1></SmallContainer>
	    		<p>{this.props.date}</p>
	    		<span className='circle'></span>
	    	</Style>		    
		)
	;}
}

export default TimelineItem;
